import styled from 'styled-components';

export const ContainerSucces = styled.div`
  margin-top: 10rem;
  text-align: center;

  button {
    border-radius: 0.6rem;
    padding: 1rem;
    margin-top: 0.8rem;
    margin-down: 0.8rem;
    text-transform: uppercase;
    text-align: center;
    color: #fbfbfb;
    background-color: hsl(224, 89%, 60%);
    border: none;
    cursor: pointer;
  }
`;
